import React, { Component } from 'react';
import {Bar, ResponsiveContainer, ChartCard} from 'rechart'

export class Acceuil extends Component {
    state={

    }
    render() {
        return (
            <div>
                <div className="content-general">  
                    <div className="col-md-12 col-sm-12 ">
                        <div className="panel-content">
                            <ChartCard>
                                <ResponsiveContainer>
                                    <Bar
                                        options={{
                                            responsive: true
                                        }}
                                        data={{
                                            data: this.state
                                        }}
                                    />
                                </ResponsiveContainer>
                            </ChartCard>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Acceuil
